import { faEye, faTrash } from '@fortawesome/free-solid-svg-icons';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import axios from 'axios';
import React, { useCallback, useEffect, useMemo, useState } from 'react';

const Item = () => {
  const [item, setItem] = useState('');
  const [states, setStates] = useState('');
  const Loaditem = useCallback(async () => {
    const result = await axios.get('http://localhost:3003/item');
    setStates([...new Set(result.data.map((x) => x.state))]);
    setItem(result.data);
    console.log('Item', item);
  }, [item]);
  const editUser = useCallback(
    async (e, rowIdx) => {
      e.preventDefault();
      await axios
        .put(`http://localhost:3003/item/${rowIdx}`, {})
        .then((response) => {
          console.log('response', response);
        })
        .catch((error) => {
          console.log('error', error);
        });
      Loaditem();
    },
    [Loaditem]
  );
  useEffect(() => {
    Loaditem();
  }, []);
  const DEALERS_COLUMN = useMemo(
    () => [
      {
        Header: '#',
        accessor: 'id',
      },
      { Header: 'Name', accessor: 'name' },
      { Header: 'City', accessor: 'city' },
      { Header: 'State', accessor: 'state' },
      { Header: 'Contact No.', accessor: 'contact' },
      {
        Header: 'Actions',
        accessor: 'action',
        disableSortBy: true,
        Cell: (props) => {
          const rowIdx = props.row.original.id;
          return (
            <div className='d-flex justify-content-around'>
              <span
                onClick={(e) => {
                  // deleteUser(e, rowIdx);
                }}>
                <FontAwesomeIcon className='icon' icon={faEye} />
              </span>
              <span onClick={() => {}}>
                <FontAwesomeIcon className='icon' icon={faTrash} />
              </span>
            </div>
          );
        },
      },
    ]
    // [deleteUser]
  );
  const columns = useMemo(() => DEALERS_COLUMN, [DEALERS_COLUMN]);
  const data = useMemo(() => item, [item]);
  return item === '' ? <div>nan</div> : <>item</>;
};

export default Item;
